  if (yymsp[-5].minor.yy83 && yymsp[-1].minor.yy25) {
     QueryNode_ApplyAttributes(yymsp[-5].minor.yy83, yymsp[-1].minor.yy25, array_len(yymsp[-1].minor.yy25), ctx->status);
  }
  array_free_ex(yymsp[-1].minor.yy25, rm_free((char*)((QueryAttribute*)ptr )->value));

