        break;
      case 103: /* num ::= SIZE */
      case 104: /* num ::= NUMBER */ yytestcase(yyruleno==104);
{
  yylhsminor.yy45.num = yymsp[0].minor.yy0.numval;
  yylhsminor.yy45.inclusive = 1;
}
  yymsp[0].minor.yy45 = yylhsminor.yy45;
